import { createSlice } from '@reduxjs/toolkit'

const namReducer = createSlice({
  name: 'nam',
  initialState: { id: 0, datas: [] },
  reducers: {
    setNamId: (state, action) => {
      return { ...state, id: action.payload }
    },
    setNams: (state, action) => {
      return { ...state, datas: action.payload }
    },
  },
})
const { actions, reducer } = namReducer
export const { setNams, setNamId } = actions
export default reducer
